text:
Pergi ke Semarang untuk wisata kuliner, lalu mampir di Tahu Gimbal Haji Edy. Keluarga saya pesan 2 porsi Tahu Gimbal dan 1 porsi Es Campur.
1. Untuk gimbal, lontong, sambal kacangnya enakk!! namun sangat disayangkan saat itu tahunya kurang fresh;
2. Es campur nya enak dan seger, cocok dimakan bersama dengan tahu gimbal ini;
3. Suasananya sangat ramai, sehingga pesanannya agak lama datangnya.

Tahu Gimbal Haji Edy worth to tryy!!!
